import { useEffect, useState } from "react";

const Create = () => {
  fetch("localhost:3001/nuevo_producto/"),
    {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(),
    };

  return "create";
};

export default Create;
